import './App.css';
import React from 'react';
import About from './components/about/about'
import Exp from './components/experience/experience'
import Cont from './components/contact/contact'
import logo from './logo.png'
import{ Routes, Route} from "react-router-dom";
import Navbar from './Navbar'


function App() {
  return (
    <div className="App">

      <header className="App-header">
        { <img src={logo} className="App-logo" alt="logo" />}

      </header>

      <Navbar/>
      <Routes>
        <Route path="/" element={<About/>}/>
        <Route exact path="/components/experience/experience" element={<Exp/>}/>
        <Route exact path="/components/contact/contact" element={<Cont/>}/>

      </Routes>













    </div>
  );
}

export default App;
